import { ContainerFilter, TitleFilter, Labe, Input } from "./Filter.styled";

const Filter = () => (


  <ContainerFilter>
    <TitleFilter>Contacts</TitleFilter>
    <Labe>
      Find contacts by name
      <Input type="text" placeholder="Enter name" onChange={handelChange} />
    </Labe>
  </ContainerFilter>
);
export default Filter;
